import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded to avoid timeout issues
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and extract product data
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const products = await page.$$eval('.product-card', (cards) => {
      return cards.map(card => {
        const title = card.querySelector('.product-title')?.textContent || '';
        const price = card.querySelector('.product-price')?.textContent || '';
        const rating = card.querySelector('.product-rating')?.textContent || '';
        const seller = card.querySelector('.seller-info')?.textContent || '';
        return { title, price, rating, seller };
      });
    });

    // Extract navigation links
    const navLinks = await page.$$eval('a', (links) => {
      return links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      }));
    });

    // Extract category information
    const categories = await page.$$eval('.category-card', (cards) => {
      return cards.map(card => card.textContent.trim());
    });

    // Extract search suggestions by triggering input
    const searchInput = await page.$('#searchInput');
    await searchInput.type('a');
    await page.waitForTimeout(1000);

    const suggestions = await page.$$eval('.suggestion-item', (items) => {
      return items.map(item => item.textContent.trim());
    });

    // Clear search input
    await searchInput.fill('');

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted product data, navigation links, categories, and search suggestions",
      extractedData: {
        products,
        navLinks: navLinks.slice(0, 50), // Limit to first 50 links
        categories,
        suggestions
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
